import React from "react";
import {BrowserRouter, Routes, Route} from "react-router-dom";

import Home from "./Home";
import NewNews from "./NewNews";
import EditNews from "./EditNews";


const App = () => {
    return(
        <>
            <BrowserRouter>
                <Routes>
                    <Route path="/" element={<Home/>}/>
                </Routes>
            </BrowserRouter>
        </>
    )
}

export default App;
